
        <!DOCTYPE html>
        <html>
        <head>
            <meta charset="UTF-8">
            <title>단비송 - 티어별 성과 비교</title>
            <style>
                
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        
        body {
            width: 1920px;
            height: 1080px;
            font-family: 'Malgun Gothic', sans-serif;
            background: linear-gradient(135deg, #0a0e1a 0%, #1a2332 100%);
            color: #ffffff;
            overflow: hidden;
            position: relative;
        }
        
        .container {
            width: 100%;
            height: 100%;
            padding: 80px 100px;
            display: flex;
            flex-direction: column;
        }
        
        .title {
            font-size: 72px;
            font-weight: bold;
            color: #ffffff;
            margin-bottom: 20px;
        }
        
        .subtitle {
            font-size: 36px;
            color: #9ca3af;
            margin-bottom: 60px;
        }
        
        .section-title {
            font-size: 48px;
            font-weight: bold;
            color: #3b82f6;
            margin-bottom: 30px;
        }
        
        .content {
            flex: 1;
            display: flex;
            gap: 60px;
        }
        
        .left-column {
            flex: 1;
            display: flex;
            flex-direction: column;
            gap: 40px;
        }
        
        .right-column {
            flex: 1;
            display: flex;
            align-items: center;
            justify-content: center;
        }
        
        .stat-box {
            background: rgba(59, 130, 246, 0.1);
            border: 2px solid #3b82f6;
            border-radius: 16px;
            padding: 30px 40px;
        }
        
        .stat-label {
            font-size: 28px;
            color: #9ca3af;
            margin-bottom: 12px;
        }
        
        .stat-value {
            font-size: 56px;
            font-weight: bold;
            color: #ffffff;
        }
        
        .comment-box {
            background: rgba(255, 255, 255, 0.05);
            border-left: 4px solid #3b82f6;
            border-radius: 8px;
            padding: 30px 40px;
        }
        
        .comment-text {
            font-size: 28px;
            line-height: 1.6;
            color: #e5e7eb;
        }
        
        .chart-container {
            width: 100%;
            height: 100%;
            display: flex;
            align-items: center;
            justify-content: center;
        }
        
        .chart-container img {
            max-width: 100%;
            max-height: 100%;
            object-fit: contain;
        }
        
        .watermark {
            position: absolute;
            bottom: 30px;
            right: 50px;
            font-size: 24px;
            color: rgba(255, 255, 255, 0.3);
            font-weight: bold;
        }
        
                
                .comment-section {
                    background: rgba(255, 255, 255, 0.05);
                    border-left: 4px solid #3b82f6;
                    border-radius: 8px;
                    padding: 24px 32px;
                    margin-bottom: 40px;
                }
                
                .comment-section .comment-text {
                    font-size: 24px;
                    line-height: 1.5;
                    color: #e5e7eb;
                }
                
                .charts-row {
                    display: grid;
                    grid-template-columns: 1fr 1fr;
                    gap: 40px;
                    flex: 1;
                }
                
                .chart-box {
                    display: flex;
                    align-items: center;
                    justify-content: center;
                }
                
                .chart-box img {
                    max-width: 100%;
                    max-height: 100%;
                    object-fit: contain;
                }
            </style>
        </head>

                <div class="subtitle">상대 티어별 비교</div>
